Race.create!([
  {game: Game.where(slug: 'wow').first, slug: "orc", name: "Генератор ников для Орка", title: "Генератор ников для Орков(РП ники, генератор roleplay ников и имен)", content: "Орки - пришельцы из мира Драенор, сейчас более известного как Запределье. Несмотря на изначальную приближенность к духам природы, исторически сложилось так, что орки стали известны в качестве кровожадных и неустрашимых воителей. Имя орка звучит грубо, зачастую резко и не отличается гармонией и красотой.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "gnome", name: "Генератор ников для Гнома", title: "Генератор ников для гномов(РП ники, генератор roleplay ников)", content: "Гномы - искусные механики и инженеры, они обожают мастерить сложные устройства, что нередко приводит к различного масштаба разрушениям. Иногда гномы связывают свою жизнь с магией, что, однако, не мешает звучать их именам так, словно вы потрясли ведро с гайками и болтами.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "dwarf", name: "Генератор ников для Дворфа", title: "Генератор ников для дварфов(РП ники, генератор roleplay ников)", content: "Дворфы появились в Азероте с момента его сотворения. Изначально их раса называлась Земельниками, но эволюция сделала своё дело, и дворфы, кряжистые и несколько грубые создания, стали такими, какими мы знаем их сейчас. Дворфы являются умелыми мастерами горного, кузнечного и пивоваренного дела, поэтому многие из имен связаны с их ремеслом.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "tauren", name: "Генератор ников для Таурена", title: "Генератор ников для Тауренов(РП ники, генератор roleplay ников и имен)", content: "Таурены ничуть не меньше ночных эльфов тяготеют к природе. В основе их традиций лежит поклонение солнцу, природе и уважение предков, давших живущим представителям расы свою бесконечную мудрость. Имена тауренов просты и легко запоминаются. Возможно, именно поэтому они звучат довольно приятно, хотя порой несложно распознать и некую воинственность.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "nightelf", name: "Генератор ников для Ночного Эльфа", title: "Генератор ников для Ночных эльфов(РП ники, генератор roleplay ников и имен)", content: "Ночные эльфы - искусные друиды и священники, отличающиеся наибольшей близостью к природе, среди прочих рас. Звучание имен ночных эльфов приятно на слух - тяга этой расы к жизни и гармонии сделала их красивыми и запоминающимися. У эльфов нет бессмысленных имен - каждый звук имеет своё значение.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "draenei", name: "Генератор ников для Дренеев", title: "Генератор ников для Дренеев (РП ники, генератор roleplay ников и имен)", content: "Дренеи - раса космических беженцев, хранящая в своих заветах поклонение свету, веру в пророчества и почитание Наару - своих небесных покровителей. Имена дренеев традиционно содержат много гласных, что делает их непривычными для слуха коренных обитателей Азерота.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "worgen", name: "Генератор ников для Воргенов", title: "Генератор ников для Воргенов(РП ники, генератор roleplay ников и имен)", content: "Напрасно Генн Седогрив ожидал, что его великая стена спасет народ Гилнеаса от любой опасности. Горькая судьба постигла жителей славного королевства несмотря на все надежды. Любой ворген - в первую очередь бывший представитель гордого королевства Гилнеас, а значит, ему пристало достойное имя. Имя, которое прославит его обладателя, несмотря на его проступающую волчью натуру.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "goblin", name: "Генератор ников для Гоблинов", title: "Генератор ников для Гоблинов(РП ники, генератор roleplay ников и имен)", content: "То, что гоблины все еще не вымерли, можно объяснить лишь их потрясающей везучестью и свойственной им деловой жилкой. Большинство представителей этой расы оказываются довольно-таки жадными, как до денег, так и до взрывчатки. Если вашего собеседника зовут как-то вроде \"Златовзрыв\" - постарайтесь не иметь с ним дел. Это может оказаться чревато для вашего кошелька, здоровья или жизни. Или - для всего и сразу.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "human", name: "Генератор ников для Человека", title: "Генератор ников для людей (человек)(РП ники, генератор roleplay ников)", content: "Люди - одна из наиболее молодых рас Азерота. Многие представители человеческой расы посвящают себя служению свету, магии или становятся доблестными воителями. Имена людей как правило просты, но неизменно несут в себе некий смысл. И ничего страшного, что со временем он позабылся или его на самом деле никогда не было.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "troll", name: "Генератор ников для Тролля", title: "Генератор ников для Троллей(РП ники, генератор roleplay ников и имен)", content: "Тролли - древняя воинственная раса, отличающася так же и уважением к традициям своего народа. Тролли недалеко продвинулись в технологиях, но чтут заветы своих шаманов, время от времени не забывая раскурить трубочку и поговорить о вуду. Имена троллей звучат порой грубовато, но не лишены некоторого шарма.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "undead", name: "Генератор ников для Нежити", title: "Генератор ников для нежити и отрекшихся(РП ники, генератор roleplay ников и имен)", content: "Отрекшиеся - восставшие люди бывшего Лордаерона. В бытность свою людьми они, разумеется, носили человеческие имена, которые сейчас, возможно, звучат слегка старомодно. Однако, это лишь придает существованию верных служителей королевы баньши некоторую горечь, не дающую позабыть об их прошлом - ведь когда-то все они были людьми.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "bloodelf", name: "Генератор ников для Эльфов Крови", title: "Генератор ников для эльфов крови(РП ники, генератор roleplay ников и имен, кровавые эльфы, блад эльфы)", content: "Эльфы крови - гордая, надменная раса, предками которой являются легендарные высшие эльфы. Они тяготеют к солнцу и магии, именно поэтому их имена нередко несут в себе нечто волшебное, гордое и неустрашимое. Звучание их имен внушает уверенность в их непоколебимости и верности идеалам своего народа.", description: ""},
  {game: Game.where(slug: 'wow').first, slug: "pandaren", name: "Генератор ников для Пандаренов", title: "Генератор ников для Пандаренов(РП ники, генератор roleplay ников и имен, панды)", content: "Пандарены - древняя раса медведеподобных существ, которые славятся своей приверженностью к пиву, боевым искусствам и самосовершенствованию. Их имена повторяют традиции Востока - каждый слог имеет собственное значение, а если перевести имя пандарена на один из распространенных в Азероте языков, несложно будет оценить всю его красоту.", description: ""}
])


